// foo20 is a GRC20 token contract where all the GRC20 methods are proxified
// with top-level functions. see also gno.land/r/demo/bar20.
package foo20

import (
	"std"
	"strings"

	"gno.land/p/demo/grc/grc20"
	"gno.land/p/demo/ownable"
	"gno.land/p/demo/ufmt"
	pusers "gno.land/p/demo/users"
	"gno.land/r/demo/users"
)

var (
	banker *grc20.Banker
	admin  *ownable.Ownable
	token  grc20.Token
)

func init() {
	admin = ownable.NewWithAddress("g1u7y667z64x2h7vc6fmpcprgey4ck233jaww9zq") // @manfred
	banker = grc20.NewBanker("Foo", "FOO", 4)
	banker.Mint(admin.Owner(), 1000000*10000) // @administrator (1M)
	token = banker.Token()
}

func TotalSupply() uint64 { return token.TotalSupply() }

func BalanceOf(owner pusers.AddressOrName) uint64 {
	ownerAddr := users.Resolve(owner)
	return token.BalanceOf(ownerAddr)
}

func Allowance(owner, spender pusers.AddressOrName) uint64 {
	ownerAddr := users.Resolve(owner)
	spenderAddr := users.Resolve(spender)
	return token.Allowance(ownerAddr, spenderAddr)
}

func Transfer(to pusers.AddressOrName, amount uint64) {
	toAddr := users.Resolve(to)
	checkErr(token.Transfer(toAddr, amount))
}

func Approve(spender pusers.AddressOrName, amount uint64) {
	spenderAddr := users.Resolve(spender)
	checkErr(token.Approve(spenderAddr, amount))
}

func TransferFrom(from, to pusers.AddressOrName, amount uint64) {
	fromAddr := users.Resolve(from)
	toAddr := users.Resolve(to)
	checkErr(token.TransferFrom(fromAddr, toAddr, amount))
}

// Faucet is distributing foo20 tokens without restriction (unsafe).
// For a real token faucet, you should take care of setting limits are asking payment.
func Faucet() {
	caller := std.PrevRealm().Addr()
	amount := uint64(1_000 * 10_000) // 1k
	checkErr(banker.Mint(caller, amount))
}

func Mint(to pusers.AddressOrName, amount uint64) {
	admin.AssertCallerIsOwner()
	toAddr := users.Resolve(to)
	checkErr(banker.Mint(toAddr, amount))
}

func Burn(from pusers.AddressOrName, amount uint64) {
	admin.AssertCallerIsOwner()
	fromAddr := users.Resolve(from)
	checkErr(banker.Burn(fromAddr, amount))
}

func Render(path string) string {
	parts := strings.Split(path, "/")
	c := len(parts)

	switch {
	case path == "":
		return banker.RenderHome()
	case c == 2 && parts[0] == "balance":
		owner := pusers.AddressOrName(parts[1])
		ownerAddr := users.Resolve(owner)
		balance := banker.BalanceOf(ownerAddr)
		return ufmt.Sprintf("%d\n", balance)
	default:
		return "404\n"
	}
}

func checkErr(err error) {
	if err != nil {
		panic(err)
	}
}

package foo20

import (
	"std"
	"testing"

	"gno.land/p/demo/testutils"
	"gno.land/p/demo/uassert"
	pusers "gno.land/p/demo/users"
	"gno.land/r/demo/users"
)

func TestReadOnlyPublicMethods(t *testing.T) {
	var (
		admin = pusers.AddressOrName("g1u7y667z64x2h7vc6fmpcprgey4ck233jaww9zq")
		alice = pusers.AddressOrName(testutils.TestAddress("alice"))
		bob   = pusers.AddressOrName(testutils.TestAddress("bob"))
	)

	type test struct {
		name    string
		balance uint64
		fn      func() uint64
	}

	// check balances #1.
	{
		tests := []test{
			{"TotalSupply", 10_000_000_000, func() uint64 { return TotalSupply() }},
			{"BalanceOf(admin)", 10_000_000_000, func() uint64 { return BalanceOf(admin) }},
			{"BalanceOf(alice)", 0, func() uint64 { return BalanceOf(alice) }},
			{"Allowance(admin, alice)", 0, func() uint64 { return Allowance(admin, alice) }},
			{"BalanceOf(bob)", 0, func() uint64 { return BalanceOf(bob) }},
		}
		for _, tc := range tests {
			got := tc.fn()
			uassert.Equal(t, got, tc.balance)
		}
	}

	// bob uses the faucet.
	std.TestSetOrigCaller(users.Resolve(bob))
	Faucet()

	// check balances #2.
	{
		tests := []test{
			{"TotalSupply", 10_010_000_000, func() uint64 { return TotalSupply() }},
			{"BalanceOf(admin)", 10_000_000_000, func() uint64 { return BalanceOf(admin) }},
			{"BalanceOf(alice)", 0, func() uint64 { return BalanceOf(alice) }},
			{"Allowance(admin, alice)", 0, func() uint64 { return Allowance(admin, alice) }},
			{"BalanceOf(bob)", 10_000_000, func() uint64 { return BalanceOf(bob) }},
		}
		for _, tc := range tests {
			got := tc.fn()
			uassert.Equal(t, got, tc.balance)
		}
	}
}

func TestErrConditions(t *testing.T) {
	var (
		admin = pusers.AddressOrName("g1u7y667z64x2h7vc6fmpcprgey4ck233jaww9zq")
		alice = pusers.AddressOrName(testutils.TestAddress("alice"))
		empty = pusers.AddressOrName("")
	)

	type test struct {
		name string
		msg  string
		fn   func()
	}

	std.TestSetOrigCaller(users.Resolve(admin))
	{
		tests := []test{
			{"Transfer(admin, 1)", "cannot send transfer to self", func() { Transfer(admin, 1) }},
			{"Approve(empty, 1))", "invalid address", func() { Approve(empty, 1) }},
		}
		for _, tc := range tests {
			t.Run(tc.name, func(t *testing.T) {
				uassert.PanicsWithMessage(t, tc.msg, tc.fn)
			})
		}
	}
}

